import Home from './Home';
//import Login from './Login';
//import Signup from './Signup';

import {Routes, Route} from 'react-router-dom';


function Main() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </div>
  );
}

export default Main;
